import React from "react";
import Navigation from "../../Navigation/Navigation";

const Yearly = () => {

    const DUMMY_MEALS = [
        {
            id: '1',
            month: 'January',
            year: '2021', budget: '500', balance: '200'
        }, { id: '1', month: 'January', year: '2021', budget: '500', balance: '200' }, { id: '1', month: 'January', year: '2021', budget: '500', balance: '200' }]

    return (
        <div>
            <Navigation></Navigation>
            <h1>Yearly balance</h1>
        </div>
    )
}

export default Yearly;
